import React from "react";

export default class TodoForm extends React.Component {
  state = {
    text: ""
  };

  render() {
    return (
      <input
        value={this.state.text}
        onChange={this.handleChange}
        placeholder="input ingredients"
      ></input>
    );
  }
}
